description:
Title: Identification of a Woman (1982)
Country: Italy | France
Language: Italian | English | French
Film Genre: Drama | Romance
IMDB URL: http://www.imdb.com/title/tt0084116/
Director: Michelangelo Antonioni
Cast: Tomas Milian, Daniela Silverio, Christine Boissonv



Plot or Synopsis
The movie director Niccolo has just been left by his wife.
This gives him the idea of making a movie about womens relationships.
He starts to search for a woman who can play the leading part in the movie - but also in his own life...


